import React, { Component } from 'react'

export class Login extends Component {
    render() {
        return (
            <div id="login">
                <div class="container">
                    <div class="row">
                        <div class="col-lg-12">
                        <form>
                            <input type="text" placeholder = "Enter email"></input>
                            <input type="password" placeholder="Enter password"></input>
                        </form>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Login
